import { BrowserRouter } from 'react-router-dom';

const App = () => {
  return (
    <BrowserRouter>
      <div>
        <Navbar />
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/newtransaction" element={<Newtransaction />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
};

export default App;
